​
​​Chadstone and Emporium Melbourne will be offering takeaway mooncakes, freshly baked or frozen for your convenience.
​
​​Frozen mooncake baking methods include:
​1. Defrost frozen moon cakes
​2. Pre heat oven to 160ᵒC
​3. Baked for 8-10 minutes, until golden brown
​4. Then flip to the other size and baked another 3-5minute
​
​Alternatively, place frozen mooncakes in a preheat oven and bake for 25 minutes.
​
