As the final cycle of the zodiac, the pig has a been-there-done-that kind of attitude. They are laid back, open-minded, generous beings who are nonetheless deeply knowledgeable and adaptable. After all, if you let a domesticated pig out in the wild, within a matter of months, it can revert back into a wild boar, growing wiry black hair and sharp tusks. They may seem like easygoing creatures, but underneath it all, a pig really knows how to live, both literally and figuratively.

If you try to get existential with a pig and ask them the meaning of life, they will probably answer something like, “Food, sex, music, and art. Not necessarily in that order.” The pig embodies the enlightened refinement humans are capable of, while simultaneously inviting us to consider that life can be extraordinarily simple…because the direct experience of our senses is a simple act if we allow it to be. So many of us overthink, justify, and strategize our indulgences. Pig Qì is enjoyment without the guilt; pleasure as simple, human honesty.  

As the end of the zodiac cycle, the pig represents a moment of letting go, of release. Let us fully inhabit our bodies without shame and consider for a moment that the most profound meaning of the universe might actually be right on the surface.
